import Header from '../layouts/header';
import { BrowserRouter } from 'react-router-dom';

export default function withHeader(HocComponent,app) {
	return class extends Component {
		render() {
      console.log('app => ',app);
console.log('this.props => ',this.props);

			return (
				<BrowserRouter>
					<Header />
					<HocComponent {...this.props.children} />
				</BrowserRouter>
			);
		}
	};
}
